(3820, 'Jarro lechero con tapa', 'Completa tu cocina con nuestro Jarro y prepara tus recetas más exigentes. Ideal para calentar leches y coladas.\r\n\r\nExterior metalizado.\r\nAsa en baquelita (no se derrite).\r\n Interior con 4 capas de antiadherente y vertedero más grande (para evitar derrames).\r\nEspesor de 1.8mm que hacen más fácil su limpieza.\r\nBase grafilada para una distribución uniforme del calor (ahorro de energía).\r\nViene en dos presentaciones de 1.500ml, con y sin tapa de vidrio.', 46900, '2021-09-15 03:43:30', '0000-00-00 00:00:00', '1', 0, 0, 0, 1, 5, 14, 1, 14, 'L39515', 0),
