(3838, 'Olla a presion dual max', 'Olla a presión en acero inoxidable brillante en aleación 304 o 18/8.\r\n Cuenta con 4 sistemas de seguridad: pesa reguladora de presión, válvula de seguridad, botón de apertura segura y ventana de seguridad.\r\n Accesorios en baquelita resistentes al calor.\r\n Disco de inducción y difusor de calor, que permite una cocción más rápida, uniforme y apto para cocinas de inducción.\r\n Espesor cuerpo: 1 mm - Espesor tapa: 1.2 mm.\r\n Dos niveles de cocción: 60 y 100 kPa.\r\n Capacidad nominal: 6 litros.\r\n Hasta 25 años de garantía por defectos de manufactura en el cuerpo de la olla.', 349900, '2021-09-15 03:43:30', '0000-00-00 00:00:00', '1', 0, 0, 0, 1, 5, 14, 1, 14, 'L37430', 0),
(3839, 'Olla a presion abre facil', 'Olla a presión elaborada en acero inoxidable. Color plateado. Superficie lisa. Contraste brillante. Tiene válvula de seguridad que garantiza máxima seguridad durante la cocción. Tiene asas auxiliares laterales en baquelita que no se calientan y son de fácil manipulación. Tiene ventana de seguridad. Perilla con sistema abre fácil. Válvula reguladora de presión. Abrazaderas y Disco termo difusor de calor que permite una cocción más rápida y uniforme. Incluye tapa de vídrio templado con salida a vapor. Practica. Resistente. Duradera. Capacidad de 4Lts. Elaborada en China.', 369900, '2021-09-15 03:43:30', '0000-00-00 00:00:00', '1', 0, 0, 0, 1, 5, 14, 1, 14, 'L37570', 0),
(3840, 'Olla presion  esencial universal 3lts', 'Aluminio: 80%\r\n- Baquelita: 10%\r\n- Caucho: 1%\r\n- Acero: 6%\r\n- Silicona: 1%\r\n- Otros: 2%\r\n\r\n Pesa de regulación que hace que la presión que se mantenga constante a 80 kPa.\r\n2. Válvula de seguridad metálica que se activa a 130 kPa y retorna automáticamente a su posición de sellado cuando la presión ha sido evacuada.\r\n3. Válvula de seguridad en caucho, se activa a 180 kPa y se debe sellar manualmente cuando se haya evacuado toda la presión interna de la olla\r\n\r\nSu cuerpo es en aluminio de 1.8 mm y su tapa en aluminio de 2 mm.\r\nSu SISTEMA AUTOAJUSTABLE permite abrir y cerrar la olla con mayor facilidad, garantizando un cierre totalmente hermético.', 86900, '2021-09-15 03:43:30', '0000-00-00 00:00:00', '1', 0, 0, 0, 1, 5, 14, 1, 14, 'L24302', 0),
(3841, 'Olla presion  esencial universal', 'Marca	UNIVERSAL\r\nModelo	23000\r\nTipo	Ollas a presión\r\nAlto	28\r\nDiámetro	22\r\nEspesor	NO APLICA\r\nCapacidad en litros	13\r\nMaterial de las ollas	Aluminio\r\nMaterial de las tapas	Aluminio\r\nTemperatura máxima	Aluminio\r\nAntiadherente	Sí\r\nCon fondo difusor	No\r\nApto para cocina de inducción	Sí\r\nApto para horno	No\r\nApto para lavavajillas	Sí\r\nHecho en	China', 126900, '2021-09-15 03:43:30', '0000-00-00 00:00:00', '1', 0, 0, 0, 1, 5, 14, 1, 14, 'L24802', 0),
(3842, 'Olla presion  esencial universal', 'olla a presion universal\r\n\r\nmaterial aluminio\r\n\r\ncapacidad 13 litros\r\n\r\nfacilidad de repuestos\r\n\r\ngran capacidad para restaurantes u hogares de familias grandes\r\n\r\nasas fenólicos que no se calientan\r\n\r\nfusibles plásticos\r\n\r\nválvula metálica', 214900, '2021-09-15 03:43:30', '0000-00-00 00:00:00', '1', 0, 0, 0, 1, 5, 14, 1, 14, 'L27230', 0),
(3843, 'Olla a presión con cierre interno LPC - 4 Litros universal', 'Producto 100% Garantizado\r\n4 sistema de seguridad.\r\nAluminio liviano y resistente.\r\nSistema autoajustable.\r\nAsa ergonómica baquelita.', 149900, '2021-09-15 03:43:30', '0000-00-00 00:00:00', '1', 0, 0, 0, 1, 5, 14, 1, 14, 'L23400', 0),
(3844, 'Olla a presión con cierre interno LPC - 6 Litros universal', 'Cuerpo en aluminio de espesor 2.0 mm\r\nCuenta con válvula de seguridad para garantizar el correcto funcionamiento y una máxima\r\nseguridad.\r\nTiene pesa para mantener estable la presión a un valor nominal de 80 KPa.\r\nViene con sistema de cierre autoajustable y hermético, para evitar fugas de presión.\r\n Mango en baquelita resistente al calor.', 159900, '2021-09-15 03:43:30', '0000-00-00 00:00:00', '1', 0, 0, 0, 1, 5, 14, 1, 14, 'L23600', 0),
(3845, 'Olla presion  esencial universal', 'Marca	Universal\r\nModelo	ESENCIAL\r\nTipo de olla de cocina	Olla a presión\r\nCapacidad en volumen	6 L\r\nFormato de venta	Unidad\r\nUnidades por pack	1\r\nOtros\r\nAltura x Ancho: 18 cm x 21 cm\r\nDiámetro: 21 cm\r\nMaterial de la olla de cocina: Aluminio de alta pureza\r\nCon revestimiento antiadherente: No\r\nIncluye tapa: Sí', 116900, '2021-09-15 03:43:30', '0000-00-00 00:00:00', '1', 0, 0, 0, 1, 5, 14, 1, 14, 'L24602', 0),
