(3847, 'Olla presion ultra universal', 'Marca	Universal\r\nCapacidad en volumen	4.5 L\r\nDescripción\r\nOlla a presion cierre externo universal\r\nDe 4.5 litros de capacidad', 94900, '2021-09-15 03:43:30', '0000-00-00 00:00:00', '1', 0, 0, 0, 1, 5, 14, 1, 14, 'L25450', 0),
(3848, 'Olla a presion aliada universal', 'Cuenta con una capacidad de 4 litros liviana y practica\r\nBotón de Seguridad en el mango para mayor ajuste\r\nCon la válvula silenciosa obtendrás cocciones mas rápidas\r\nHecha en Aluminio de alta pureza resistente\r\n100% Colombiano', 86900, '2021-09-15 03:43:30', '0000-00-00 00:00:00', '1', 0, 0, 0, 1, 5, 14, 1, 14, 'L26401', 0),
(3849, 'Olla a presion alida ci 6 litros uv2 universal', 'OLLA A PRESIÓN UNIVERSAL con cuerpo en aluminio de 1.8 mm y tapa en aluminio de 2 mm. VÁLVULA DE SEGURIDAD: Para un perfecto funcionamiento y máxima seguridad. (Dispositivo para liberar la Presión de manera fácil y segura). SISTEMA AUTOAJUSTABLE: Permite abrir y cerrar la olla con mayor facilidad, garantizando un cierre totalmente hermético. Instrucciones cuidado del producto: No llene la olla más de 2/3 de su capacidad. Cuando son productos que crecen durante la cocción, no llena la olla más de 1/2 de su capacidad. Nunca cocine alimentos que generen espuma. No toque las superficies calientes, use los mangos y asas. No usar la olla a presión dentro del horno. Siempre revise el tubo de escape y asegúrese de que no esté obstruido. No use la olla para freír. ¡Cómprala ya', 96900, '2021-09-15 03:43:30', '0000-00-00 00:00:00', '1', 0, 0, 0, 1, 5, 14, 1, 14, 'L26602', 0),
(3850, 'Olla a presión Óptima 6 Litros universal', '5 Sistemas de seguridad\r\nDisco de inducción y difusor de calor\r\nTecnología de punta\r\n25 años de garantía\r\nTecnología de punta', 234900, '2021-09-15 03:43:30', '0000-00-00 00:00:00', '1', 0, 0, 0, 1, 5, 14, 1, 14, 'L37460', 0),
(3851, 'Olla presion ultra universal', '¡Es momento de renovar tus ollas! Renueva tu cocina con la OLLA A PRESIÓN UNIVERSAL ULTRA 6 LITROS. Esta olla es perfecta para cocinar de manera rápida y segura, sus accesorios (mango y asa) en baquelita te brindarán mayor seguridad ya que este material no es conductor del calor, evitando quemaduras al sujetarse, cuenta con diseño de cierre externo para mayor facilidad al abrir y cerrar, fabricada en aluminio con terminaciones brillantes para darle un toque de elegancia a tu cocina. ¡Cómprala ya!', 99900, '2021-09-15 03:43:30', '0000-00-00 00:00:00', '1', 0, 0, 0, 1, 5, 14, 1, 14, 'L25690', 0),
(3852, 'Olla presión ultra nova CE 6l universal', 'Característica\r\nAluminio de espesor del cuerpo: 2.7 mm; Ventana de seguridad; Válvula de seguridad; Botón de seguridad para apertura de la Olla; Válvula silenciosa para una cocción más rápida; Botón de seguridad para apertura de la Olla; Cuerpo y tapa en aluminio; Accesorios en baquelita resistentes al calor.', 157900, '2021-09-15 03:43:30', '0000-00-00 00:00:00', '1', 0, 0, 0, 1, 5, 14, 1, 14, 'L29690', 0),
(3853, 'Caldero fund pomo ens', 'Asas: grandes para mejor agarre y mayor seguridad al transportarlos.\r\n Acabados: Interior brillo perlado.\r\nMateriales del producto\r\nAluminio: 95%.\r\nPolipropileno: 5%.\r\nRecomendaciones\r\nSolo para uso doméstico.\r\nNo calientes sin alimento en el interior.\r\nLa llama no se debe extender hasta las paredes del producto.\r\nNo introduzcas en hornos convencionales ni microondas.\r\nSiempre usa protección para retirar el producto después de usarlo.\r\ntamaño : 18cm\r\nMarca Universal', 33900, '2021-09-15 03:43:30', '0000-00-00 00:00:00', '1', 0, 0, 0, 1, 5, 14, 1, 14, 'L79023', 0),
(3854, 'Caldero fund pomo ens', 'Base Antideslizante\r\nAsas más gruesas para mejor agarre\r\nAluminio de alta pureza\r\nResumen del producto\r\nEl Caldero IMUSA 20 cm Tapa de Aluminio Fundido esta elaborado en aluminio el cual es un excelente conductor y conservador de temperatura que agiliza el proceso de cocción. Adicionalmente, es altamente resistente a golpes e impactos por sus paredes extra gruesas y su resistente material.Caldero fabricado con materiales aptos para el contacto con alimentos, de alta pureza, certificados y que protegen la salud. ¡Encuentralo aquí!', 37900, '2021-09-15 03:43:30', '0000-00-00 00:00:00', '1', 0, 0, 0, 1, 5, 14, 1, 14, 'L79024', 0),
