(4039, 'TERMO MORADO', 'TERMO MORADO 0.45L V2  Todo será diferente con nuestro termo, gracias a su diseño, capacidad y fácil funcionamiento.\r\n\r\nTamaño es cómodo y fácil de llevar a todas partes.\r\nTienes la opción de poder disfrutar de las bebidas como más te gustan, frías o calientes.\r\nAntes de usar el producto debes realizar un curado de esta manera: si lo vas a usar para bebidas frías, el primer uso debe ser con agua fría; y si lo vas a usar con agua caliente, debes echarle agua caliente', 27400, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '1', 0, 0, 0, 1, 5, 14, 1, 27, 'L60567', 0),
