(4931, 'NEW GIXXER 150 ABS\r\n', 'La New Gixxer 150 ABS Suzuki ahora viene con tecnología avanzada de inyección de combustible y un sistema de frenos antibloqueo (ABS) controlado electrónicamente que produce una fuerza de frenado estable en diversas condiciones de la superficie de la carretera.<br>\r\nTransmisión: 5 velocidades<br>\r\nCilindraje: 155 cm3<br>\r\nMotor:4 tiempos, 1 cilindro, refrigerado por aire<br>\r\nSuspensión delantera: Telescópica<br>\r\nSuspensión trasera: Mono amortiguado<br>\r\nSistema de valvulas:2 Válvulas\r\n', 8897000, '2021-11-02 09:31:51', '2021-11-02 09:31:51', '1', 0, -1, 0, 1, 11, 18, 31, 158, '0', 0),
(4932, 'NEW GIXXER SF 150\r\n', 'La New Gixxer Suzuki ahora viene con frenos ABS y tecnología avanzada de inyección de combustible que mejora la eficiencia del combustible y la respuesta del acelerador. ¡6 sensores calculan los datos en tiempo real para obtener la cantidad óptima de combustible que se inyectará para una mejor eficiencia de combustión, lo que resulta en una mejorada eficiencia del combustible y una respuesta precisa del acelerador!<br>\r\nTrasmisión: 5 velocidades<br>\r\nCilindrada: 155 cm₃<br>\r\nMotor: 4 tiempos, 1 cilindro, refrigerado por aire<br>\r\nSuspensión delantera: Telescópica<br>\r\nSuspensión trasera: Mono amortiguado<br>\r\nSistema de válvulas:  2 Válvulas<br>\r\nDiámetro de carrera: 56.0 mm x 62.9 mm<br>\r\nSistema de combustible: Inyección Electrónica <br>\r\nArranque: Eléctrico.\r\n\r\n\r\n', 9514000, '2021-11-02 09:44:31', '2021-11-02 09:44:31', '1', 0, 0, 0, 1, 11, 18, 31, 158, '', 0),
(4933, 'GIXXER 250\r\n', 'Presentamos la nueva Suzuki Gixxer 250. De los fabricantes de Hayabusa y GSX-R, llega la Gixxer 250 para formar parte de un linaje de leyendas. El motor de la GIXXER 250 proporciona alto rendimiento, gracias a su forma compacta, bajo consumo de combustible, alta durabilidad y facilidad de mantenimiento.<br>\r\nTrasmisión:6 velocidades<br>\r\nCilindraje:  249 cm₃<br>\r\nMotor:4 tiempos, 1 cilindro, refrigerado por aceite<br>\r\nPotencia: 26.1Hp@9000 rpm<br>\r\nFrenos: Discos ABS adelante y atras', 12860000, '2021-11-02 09:54:52', '2021-11-02 09:54:52', '1', 0, 0, 0, 1, 11, 18, 31, 158, '0', 0),
(4934, 'GIXXER SF 250\r\n', 'Presentamos la nueva Suzuki Gixxer SF 250. De los fabricantes de Hayabusa y GSX-R, llega la Gixxer 250 para formar parte de un linaje de leyendas. El motor de la GIXXER 250 proporciona alto rendimiento, gracias a su forma compacta, bajo consumo de combustible, alta durabilidad y facilidad de mantenimiento. Conoce su sistema ABS de doble canal y toda la tecnología de Moto GP ahora a tu alcance.<br>Transmisión: 6 velocidades<br>Cilindraje:249 cm₃<br>Motor: 4 tiempos, 1 cilindro, refrigerado por aceite <br>Potencia máxima: 26.1Hp@9000 rpm<br>Torque: 22.2Nm@7500 rpm<br>Frenos: Disco ABS ambos lados', 13910000, '2021-11-02 10:09:27', '2021-11-02 10:09:27', '1', 0, 0, 0, 1, 11, 18, 31, 158, '0', 0),
(4935, 'GSX-S150\r\n', 'La GSX-S heredó las tradicionales  luces LED de la serie GSX-R. El brillo y la compacidad de las luces LED contribuyen en gran medida a la apariencia aguda y deportiva de la GSX-S. También utilizado para las luces de posición y la luz de matrícula. La luz trasera no es LED, pero la forma de corte del lente le da una apariencia brillante.<br>Motor: 4-Tiempos, 1 Cilindro, refrigerada por líquido, DOHC 4 válvulas.<br>Cilindraje: 150 cm3 <br>Sistema de encendido: Eléctrico y pedal<br>Transmisión: 6 velocidades de engranaje constante<br>Torque: 14.0 Nm / 9,000 rpm<br>Potencia máxima: 18.9 Hp / 10,500 rpm<br>Sistema de combustible: Inyección de combustible ( FI )', 10000000, '2021-11-02 10:17:30', '2021-11-02 10:17:30', '1', 0, 0, 0, 1, 11, 18, 31, 158, '0', 0),
(4936, 'AX4 EURO 3\r\n', 'Una versión renovada que cuenta con arranque eléctrico y de pedal, así como un sistema DC-CDI que optimiza el tiempo de encendido mejorando sustancialmente la eficiencia del combustible. El carburador tipo BS, ofrece una mezcla apropiada incluso durante una aceleración repentina, contribuyendo en gran manera a mejorar la eficiencia de la combustión.<br>Motor: 4 tiempos refrigerado por aire SOHC<br>Cilindrada: 113 cc <br>Sistema de encendido: CDI <br>Frenos: Tambor<br>Carburador: MIKUNI Bs22', 4729000, '2021-11-02 10:23:04', '2021-11-02 10:23:04', '1', 0, 0, 0, 1, 11, 18, 31, 158, '0', 0),
(4937, 'AX4 EVOLUTION EURO 3\r\n', 'Ya sea para trabajo diario o para quien se inicia en el mundo del motociclismo, la AX4 Evolution mantiene el asombroso rendimiento y la facilidad de manejo de su predecesora, ofreciendo así una excelente relación costo-beneﬁcio. Su increíble resistencia y bajos costos de mantenimiento, dan como resultado la combinación ganadora para quienes buscan economía, eﬁciencia y un estilo práctico y moderno. Esta versión también incluye arranque eléctrico y de pedal.<br>Motor: 4 tiempos, 1 cilindro, enfriado por aire SOHC<br>Cilindrada: 112.8cc\r\nTransmisión: 4 velocidades de engranaje constante<br>Sistema de combustible: Carburador MIKUNI BS22<br>Frenos: Tambor', 4589000, '2021-11-02 10:40:15', '2021-11-02 10:40:15', '1', 0, 0, 0, 1, 11, 18, 31, 158, '0', 0),
(4938, 'GN 125 EURO 3\r\n', 'Posee un sistema de encendido eléctrico, amortiguación delantera telescópica y trasera en espiral ajustable en 5 posiciones, seguro freno de disco delantero, tanque de combustible de 10.3 litros a parte de su reserva de 2lt.<br>Motor: 4 tiempos, 1 cilindro, motor refrigerado por aire, SOHC, 2 válvulas <br>Cilindrada:  124.cc <br>Transmisión: 5 velocidades<br>Sistema de arranque: Eléctrico<br>Diámetro por carrera: 57 mm x 48.9 mm', 5518000, '2021-11-02 10:44:25', '2021-11-02 10:44:25', '1', 0, 0, 0, 1, 11, 18, 31, 158, '0', 0),
(4939, 'ACCESS 125 FI\r\n', 'La nueva Suzuki Access 125 FI combina lo mejor de ambos mundos. Con sus características de clase mundial y emocionantes opciones de color, está lista para llevar su estilo de vida a un nuevo nivel de emoción. Esta maravillosa combinación de poder y estilo seguramente te dejará sorprendido.<br>Transmisión: CVT (Correa)<br>Cilindraje: 124 cm3<br>Motor:\r\n4 tiempos, 1 cilindro, refrigerado por aire.<br>Suspensión delantera: Telescópica<br>Suspensión trasera: Mono amortiguado<br>Sistema de combustible: Inyección Electrónica', 7467000, '2021-11-02 10:57:03', '2021-11-02 10:57:03', '1', 0, 0, 0, 1, 11, 18, 31, 159, '0', 0),
(4940, 'ADDRESS FI\r\n', 'Esta atractiva e inteligente scooter es mucho más que un elegante medio de transporte, brillantísima aceleración deportiva y un consumo de combustible mínimo, así como un amplio espacio de almacenaje bajo el asiento de 20.6 litros, con capacidad para un casco y otros elementos.<br>Cilindraje: 113 cm₃<br>Motor: 4 tiempos, 1 cilindro enfriado por aire<br>Transmisión: Automática correa en V<br>Sistema de combustible: Inyección Electrónica<br>Sistema de arranque: Eléctrico y pedal<br>RELACIÓN DE REDUCCIÓN FINAL: Cambio variable (2.655 - 0.806)', 6989000, '2021-11-02 11:00:53', '2021-11-02 11:00:53', '1', 0, 0, 0, 1, 11, 18, 31, 159, '', 0),
(4941, 'BURGMAN\r\n', 'Diseño, elegancia y confort, que reflejan las características más imponentes de sus hermanas mayores del segmento Maxi Scooter. La familia Burgman abre una nueva categoría en el portafolio de motocicletas Suzuki. Diseño de lujo siguiendo la tendencia Europea de Suzuki<br>Motor: 4 tiempos, refrigerado por aire, SOHC, 1 cilindro<br>Cilindraje: 124.3 cm3<br>Diámetro por carrera 52.5 mm x 57.4 mm<br>Sistema de combustible: carburador<br>Sistema de encendido: Patada, Eléctrico<br>Transmisión: CVT ( Correa )', 7249000, '2021-11-02 11:14:53', '2021-11-02 11:14:53', '1', 0, 0, 0, 1, 11, 18, 31, 159, '0', 0),
(4942, 'DR150\r\n', 'La nueva Suzuki DR 150 desafía todo terreno con un nuevo estilo, una apariencia moderna y una increíble comodidad, tanto en trayectos largos como en ciudad.  La DR 150 no tiene límites y puede rodar sobre varios terrenos para que la aventura continúe cuando el asfalto termine.<br>Cilindraje: 149 cm₃<br>Motor: 4 tiempos, 1 cilindro enfriado por aire<br>Sistema de válvulas: SOHC 2 Válvula<br>Potencia máxima: 12,20 HP a 8000 rpm<br>Torque: 12,7 a 6,000 RPM<br>Sistema de combustible: Carburador<br>Sistema de arranque: Eléctrico y pedal', 9190000, '2021-11-02 11:22:01', '2021-11-02 11:22:01', '1', 0, 0, 0, 1, 11, 18, 31, 160, '0', 0),
(4943, 'NEW BEST 125 FI\r\n', 'Con una apariencia deportiva esta motocicleta de 125 c.c. y motor de 4 tiempos, es perfecta para alcanzar las velocidades indicadas en la ciudad. Sus detalles son asombrosos: stop tipo led, farola multireflectiva, velocímetro sin guayas que permite una dirección más liviana y compacta.<br>Transmisión: 4 velocidades<br>Cilindrada: 124 cm3 <br>Motor: 4 tiempos, refrigerado por aire SOHC, 1 cilindro<br>Potencia máxima: 9,38 HP @ 8000 rpm<br>Torque: 1,01 Kg-m @5000 rpm', 8580000, '2021-11-02 11:27:07', '2021-11-02 11:27:07', '1', 0, 0, 0, 1, 11, 18, 31, 161, '0', 0),
(4944, 'VIVA R COOL EURO 3\r\n', 'Una motocicleta cómoda y económica que ofrece una variedad de detalles de alta calidad como un arranque eléctrico y de pedal, suspensión suave y confortable al momento de conducir, suavidad entre cambios de marcha y un bajo consumo de combustible.<br>Transmisión: 4 velocidades<br>Cilindrada: 113 cm3<br>Motor: 4 tiempos, refrigerado por aire SOHC, 1 cilindro<br>Torque: 0.89 Kg-m a 5000 rpm', 6390000, '2021-11-02 11:33:08', '2021-11-02 11:33:08', '1', 0, 0, 0, 1, 11, 18, 31, 161, '0', 0),
(4945, 'VIVA R STYLE EURO 3\r\n', 'Es una motocicleta cómoda y económica que ofrece una variedad de detalles de alta calidad como freno de disco delantero, suspensión suave, encendido electrónico y mecánico. Es confortable al momento de conducir al tiempo que ofrece suavidad entre cambios de marcha y un bajo consumo de combustible.<br>Motor: 4 tiempos, 1 cilindro, refrigerado por aire; SOHC.<br>Cilindrada: 112.8 cm3<br>ALIMENTACIÓN: Carburador MIKUNI BS22<br>Sistema de encendido: Eléctrico y de patada<br>Sistema de lubricación: Carter húmedo', 6759000, '2021-11-02 11:38:24', '2021-11-02 11:38:24', '1', 0, 0, 0, 1, 11, 18, 31, 161, '0', 0),
(4946, 'CR4 125 SE UNISHOCK', 'La CR4 125 SE UNISHOCK es una moto liviana, versátil y económica que le permite al usuario adaptarse a la ciudad de una forma divertida y dinámica, inspirada en un usuario enérgico, agresivo y veloz, amante de los nuevos diseños y sobre todo de las nuevas tecnologías, por esto ahora viene con suspensión UNISHOCK lo que te proporciona una mejor lectura del pavimento, aumentando tu estabilidad y rendimiento.<br>Motor	CGR 4T OHV<br>\r\nCilindraje	124 c.c.<br>\r\nPotencia	10Hp (7.5Kw) @ 8000 rpm<br>\r\nTorque Max	9.2 Nm @ 8000 rpm<br>\r\nCompresión	9.5:1<br>\r\nArranque	Eléctrico y a patada<br>\r\nSuspensión Delantera	Telescópica hidráulica<br>\r\nSuspensión Trasera	Unishock<BR>\r\nFreno Delantero	Disco<br>\r\nFreno Trasero	Tambor<br>', 5590000, '2021-11-02 14:11:33', '2021-11-02 14:11:33', '1', 0, 0, 0, 1, 11, 18, 32, 162, '0', 0),
