(5011, 'STRYKER 125', 'La nueva TVS Stryker 125 esta cargada de detalles, diseño moderno, estilo imponente y atractivo, tablero digital, localizador de parqueo y muchos mas que te sorprenderán en cada kilometro. Será la compañera perfecta para trabajar, moverte por la ciudad o simplemente salir a rodar con quien mas te gusta.<br>\r\nMOTOR 4 TIEMPOS, MONOCILÍNDRICO, SOHC REFRIGERADA POR AIRE<br>\r\nPOTENCIA 10.86 HP 8000 RPM<br>\r\nCILINDRAJE 124.5 CC<br> \r\nCAJA DE VELOCIDADES MECÁNICA 4 VELOCIDADES<br><br>\r\nPrecio sin gastos de matrícula ni SOAT.', 5799000, '2021-11-08 07:51:30', '2021-11-08 07:51:30', '1', 0, 0, 0, 1, 11, 18, 37, 177, '0', 0),
(5012, 'MAX 125', 'Si buscas una motocicleta resistente, potente y versátil que pueda responder a tus exigencias tanto en pavimento como en terrenos destapados esta es tu motocicleta, además esta hecha a tu altura para que la manejes cómodamente. Llantas doble propósito de R19″ adelante y R16″ atrás, un freno de disco delantero de 240 mm y cargador USB la hacen una propuesta ideal para ti.<br>\r\nCILINDRAJE 124.53<br>\r\nMOTOR 4 TIEMPOS, MONOCILÍNDRICO<br>\r\nTORQUE MÁXIMO 10.8 @ 5500 RPM<br>\r\nPOTENCIA MÁXIMA 10.86 @ 8000 RPM<br>\r\nSISTEMA DE ALIMENTACIÓN CARBURADOR<br>\r\nDIÁMETRO POR CARRERA 57 MM X 48.8 MM<br>\r\nREFRIGERACIÓN AIRE<br>\r\nCOMBUSTIBLE CORRIENTE<br>\r\nARRANQUE ELÉCTRICO Y PEDAL<br>\r\nTRANSMISIÓN MECÁNICA 4 VELOCIDADES<br><br>precio no incluye costos de matricula ni soat', 5799000, '2021-11-08 08:21:53', '2021-11-08 08:21:53', '1', 0, 0, 0, 1, 11, 18, 37, 177, '0', 0),
(5013, 'APACHE RTR 200 4V', 'Algo nunca antes visto en las motos de su categoría. La Apache RTR 200 4V es una de las motos más codiciadas de la familia Apache por su comodidad, amplia conectividad y por ofrecer a su piloto una máquina confiable para conquistar las carreteras ¡Ahora llega completamente renovada con el respaldo de Auteco.<br>\r\nMOTOR 4 TIEMPOS, MONOCILÍNDRICO, SOHC AIRE / ACEITE<br>\r\nPOTENCIA 20.24 HP 8000 RPM<br>\r\nCILINDRAJE 197.75 CC<br>\r\nCAJA DE VELOCIDADES MECÁNICA 5 VELOCIDADES<br><br>\r\nprecio no inlcuye costos de matricula ni soat', 9099000, '2021-11-08 08:33:26', '2021-11-08 08:33:26', '1', 0, 0, 0, 1, 11, 18, 37, 178, '0', 0),
(5014, 'APACHE RTR 160 4V', 'Con la nueva Apache RTR 160 4V nada volverá a ser igual. Experimenta su tecnología Smart Xconnect y disfruta su ecosistema de conexión, telemetría en ruta, alerta y asistencia en navegación.<br>\r\nCILINDRAJE 159.7 CC<br>\r\nMOTOR 4 TIEMPOS, MONOCILÍNDRICO, SOHC<br>\r\nTORQUE MÁXIMO 14.8 NM @ 6500 RPM<br>\r\nPOTENCIA MÁXIMA 16.28 HP @ 8000RPM<br>\r\nRELACIÓN DE COMPRESIÓN 10.15:1<br>\r\nSISTEMA DE ALIMENTACIÓN CARBURADOR<br>\r\nREFRIGERACIÓN AIRE / ACEITE<br>\r\nARRANQUE ELÉCTRICO<br>\r\nTRANSMISIÓN MECÁNICA 5 VELOCIDADES<br><br>precio no incluye costo de matricula ni soat', 7849000, '2021-11-08 08:39:19', '2021-11-08 08:39:19', '1', 0, 0, 0, 1, 11, 18, 37, 178, '0', 0),
