(5016, 'APACHE RTR 180 2V', 'Precio sin gastos de matrícula ni SOAT.<br>\r\nLa Apache RTR 180 2V está equipada con calidad y potencia. Siente la comodidad y el desempeño de una moto deportiva diseñada para rendir y trabajar.Precio sin gastos de matrícula ni SOAT.<br>\r\nMOTOR 4 TIEMPOS, MONOCILÍNDRICO, SOHC AIRE<br>\r\nPOTENCIA 15.02 HP 8500 RPM<br>\r\nCILINDRAJE 177.4 CC<br>\r\nCAJA DE VELOCIDADES MECÁNICA 5 VELOCIDADES<br><br>', 7399000, '2021-11-08 09:06:06', '2021-11-08 09:06:06', '1', 0, 0, 0, 1, 11, 18, 37, 178, '0', 0),
