(5018, 'APACHE 200 4V FI ABS', 'PRECIO SIN GASTOS DE MATRÍCULA NI SOAT.<br><br>\r\n\r\n¡La 200 más completa llega a la familia Apache! La Apache 200 FI ABS es la moto más completa en su categoría que está equipada de 3 modos de manejo, RT FI, conectividad Smart X Connect, frenos ABS y mucho más. Y cuenta con el respaldo de Auteco.<br>\r\nCILINDRAJE 200cc<br>\r\nMOTOR 4 TIEMPOS, MONOCILÍNDRICO<br>\r\nTORQUE MÁXIMO 17.25 NM @ 7250 RPM<br>\r\nPOTENCIA MÁXIMA 20.54 HP @ 9000 RPM<br>\r\nSISTEMA DE ALIMENTACIÓN INYECCIÓN ELECTRÓNICA<br>\r\nREFRIGERACIÓN AIRE / ACEITE<br>\r\n\r\nARRANQUE ELÉCTRICO<br>\r\n', 10899000, '2021-11-08 09:21:08', '2021-11-08 09:21:08', '1', 0, 0, 0, 1, 11, 18, 37, 178, '0', 0),
