(5020, 'TVS NTORQ 125 RACE EDITION', 'Precio sin gastos de matrícula ni SOAT.<br><br>\r\n\r\nPensada para traer el ADN de las pistas de carreras a la ciudad, la scooter Ntorq 125 Race Edition lleva más allá las características de su hermana la Ntorq 125. Si buscas redefinir lo que creías saber sobre estas motos, es momento de que te subas en uno de los scooters con mayor conectividad en el mercado. ¡Ahora con el respaldo de Auteco!<br>\r\nMOTOR 4 TIEMPOS, MONOCILÍNDRICO, SOHC AIRE<br>\r\nPOTENCIA 9.25 HP 7500 RPM<br>\r\nCILINDRAJE 124.79 CC<br>\r\nCAJA DE VELOCIDADES AUTOMÁTICA<br>', 7449000, '2021-11-08 09:50:34', '2021-11-08 09:50:34', '1', 0, 0, 0, 1, 11, 18, 37, 179, '0', 0),
(5021, 'TVS NTORQ 125', 'Precio sin gastos de matrícula ni SOAT.<br><br>\r\n\r\nDiseñada para ser un ícono urbano, la TVS Ntorq 125 está lista para sorprenderte al ser la scooter más conectada de Colombia. Disfruta de su impresionante tecnología Smart X Connect y de su potencia inigualable que te hará destacar en cada recorrido.<br>\r\nMOTOR 4 TIEMPOS, MONOCILÍNDRICO, SOHC AIRE<br>\r\nPOTENCIA 9.25 HP 7500 RPM<br>\r\nCILINDRAJE 124.79 CC<br>\r\nCAJA DE VELOCIDADES AUTOMÁTICA<br>', 6899000, '2021-11-08 09:54:02', '2021-11-08 09:54:02', '1', 0, 0, 0, 1, 11, 18, 37, 179, '0', 0),
