(5023, '200 DUKE', 'Es más rápida incluso de lo que su imagen sugiere. Esta luchadora es la única motocicleta naked de 200 cc dotada de un ADN de competición pura. Componentes de alta tecnología, como el ultracompacto motor monocilíndrico 4 tiempos de refrigeración líquida, el chasis multitubular, la avanzada inyección electrónica, las suspensiones WP de alta gama y el atractivo basculante, todo está perfectamente integrado para garantizar la máxima diversión de manejo y el dinamismo en curvas.<br>\r\nMOTOR: 4 TIEMPOS, MONOCILÍNDRICO<br>\r\nCILINDRADA: 199.5 CC<br>\r\nPOTENCIA MÁXIMA: 25.5 HP @ 10000 RPM<br>\r\nTORQUE MÁXIMO: 19.5 NM @ 8000 RPM<br>\r\nSISTEMA DE ALIMENTACIÓN: INYECCIÓN ELECTRÓNICA<br>\r\nREFRIGERACIÓN: LÍQUIDA<br>\r\nARRANQUE: ELÉCTRICO<br><br>precio no incluye costo de matricula ni soat', 12990000, '2021-11-08 14:07:54', '2021-11-08 14:07:54', '1', 0, 0, 0, 1, 11, 18, 38, 181, '0', 0),
(5024, '200 DUKE NG', 'Impulsada por un potente motor monocilíndrico, la KTM 200 DUKE no sólo ofrece una aceleración adictiva, sino también conducción diaria cómoda y ágil. Con 19 Nm, es la opción de 4 tiempos más potente de su categoría. Gracias a su caja filtro y escape, cumple con los más altos estándares de emisiones y ruidos, al tiempo que proporciona el máximo rendimiento<br>\r\nMOTOR: 4 TIEMPOS, MONOCILÍNDRICO<br>\r\nCILINDRADA: 199.5 CC<br>\r\nPOTENCIA MÁXIMA: 24.7 HP @ 10000 RPM<br>\r\nTORQUE MÁXIMO: 19.3 NM @ 8000 RPM<br>\r\nSISTEMA DE ALIMENTACIÓN: INYECCIÓN ELECTRÓNICA<br>\r\nREFRIGERACIÓN: LÍQUIDA<br>\r\nARRANQUE: ELÉCTRICO<br><br>precio no incluye costo de matricula ni soat', 14990000, '2021-11-08 14:18:02', '2021-11-15 14:18:02', '1', 0, 0, 0, 1, 11, 18, 38, 181, '0', 0),
(5025, '390 DUKE NG', 'El motor de la KTM 390 DUKE no solo ofrece un abundante par y una potente aceleración, sino también un manejo cómodo en el uso diario, y todo ello con una excelente economía de combustible. Este motor ligero y compacto es realmente muy potente entregando 43 HP a 9000 rpm. Gracias al ingenioso diseño de la admisión y al preciso sistema de inyección de combustible, la KTM 390 DUKE está lista para arrasar tanto en las calles como en los circuitos.<br>\r\nMOTOR: 4 TIEMPOS, MONOCILÍNDRICO<br>\r\nCILINDRADA: 373 CC<br>\r\nPOTENCIA MÁXIMA: 43 HP @ 9000 RPM<br>\r\nTORQUE MÁXIMO: 36 NM @ 7000 RPM<br>\r\nSISTEMA DE ALIMENTACIÓN: INYECCIÓN ELECTRÓNICA<br>\r\nREFRIGERACIÓN: LÍQUIDA<br>\r\nARRANQUE: ELÉCTRICO<br><br>precio no incluye costo de matricula ni soat', 24990000, '2021-11-08 14:22:45', '2021-11-08 14:22:45', '1', 0, 0, 0, 1, 11, 18, 38, 181, '0', 0),
