(5027, 'KYMCO AGILITY ALL NEW', 'Esta scooter de la marca Kymco es un modelo completamente renovado, que nos da la posibilidad de tener todo un universo diferente, una manera de ver la calle que combina el estilo, la agilidad y la libertad de movimientos.<br>\r\nCILINDRAJE	124.6 cc<br>\r\nPOTENCIA MÁXIMA	9.5 HP @ 7500 rpm<br>\r\nTORQUE MÁXIMO	10.1 Nm @ 5500 rpm<br>\r\nSISTEMA DE ALIMENTACIÓN	Carburador<br><br>precio no incluye costo de matricula ni soat', 9799000, '2021-11-08 14:46:50', '2021-11-08 14:46:50', '1', 0, 0, 0, 1, 11, 18, 39, 182, '0', 0),
(5028, 'KYMCO TWIST', 'Ahora le vas a dar un nuevo Twist a tu vida con mucho más estilo y personalidad. La Twist se renueva y se adapta aún más para la ciudad con sus nuevas calcomanías, sillín, sliders Nitrus y un amplio maletero, los cuales te brindarán comodidad y facilidad mientras te mueves por las calles en tu día a día. ¡Una scooter económica, ágil y fácil!<br>CILINDRAJE	124.6 cc<br>\r\nPOTENCIA MÁXIMA	9.3 Hp @ 7500 rpm<br>\r\nTORQUE MÁXIMO	9,9 Nm @ 5500 rpm<br>\r\nSISTEMA DE ALIMENTACIÓN	Carburador<br><br>precio no incluye costo de matricula ni soat', 6399000, '2021-11-08 14:49:31', '2021-11-08 14:49:31', '1', 0, 0, 0, 1, 11, 18, 39, 182, '0', 0),
